import React from 'react'
import styled from 'styled-components'
import img from "../images/1.png"

const DetailsFeedScreen = () => {
  return (
    <Main>
        <Img>
            <img src={img} />
        </Img>
        <span className='imgtext'>
            <span>hellow rold hwo are you ding</span>
            <Img2>
                <img src={img}/>
            </Img2>
        </span>
        <div>
        <span>13m views . 2 days ago</span>
        <div>
            <div>
                {/* <Icon /> */}
                <p>73k</p>
            </div>
            <div>
                {/* <Icon /> */}
                <p>30k</p>
            </div>
        </div>
        </div>

        <div>
            <Img2>
                <img src={img}/>
            </Img2>
            <div>
                <button>SUBCRIBED</button>
                <h3>3m Subcribers</h3>
            </div>
        </div>
    </Main>
  )
}

export default DetailsFeedScreen

const Main = styled.div`
width: 67%;
background-color: #282828;
min-height: 100vh;
z-index: -1;

.imgtext {
    position: absolute;
    top: 10%;
    left: 30%;
    color: white;
    font-size: 25px;
    text-shadow: 2px 2px 2px black;
    display: flex;
}
`
const Img = styled.div`
width: 100%;
overflow: hidden;
height: 60vh;
display: grid;
place-items: center;
position: relative;
img {
    width: 100%;
}
`
const Img2 = styled.div`
width: 10%;
overflow: hidden;
height: 10vh;

img {
    width: 100%;
}
`
